import React, { useState } from 'react'

const Cnt2 = () => {
  const {cnt,setCnt} = useState(0);
  
  function increase(){
    setCnt(cnt => cnt+1)
  }
  function decrease(){
    setCnt(cnt => cnt-1)
  }
  return (
    <div>
      <button onClick={increase}>+1</button>
      <button onClick={decrease}>-1</button>
      {cnt}
    </div>
  )

}

export default Cnt2
